import React from 'react';
import Select from 'react-select';

const options = [
    {value: "fiction", label: "Fiction"},
    {value: "non-fiction", label: "Non-fiction"},
    {value: "mystery", label: "Mystery"}
]

function GenreOptions () {
    return (
        <Select 
            isMulti 
            options={options} />
    )
}

export default GenreOptions
